    false,nt"url": null,nt"notes": "The project involves vegetative rehabilitation
    of a creek that runs alongside the site designated for the Ankeny NWR Nature Center.
    The project will promote community involvement and environmental education in the
    spirit of the purpose of the Nature Center. Community volunteers and students will
    assist with cuttings and plantings. Student and community involvement will build
    ownership for habitat restoration and for the Nature Center. The project will be
    an on-going teaching tool at the Nature Center, and will stimulate community pride.
    Ultimately the habitat produced by the project will significantly contribute to
    the viewing and educational opportunities at the site.The project will capitalize
    upon its nexus to the Nature Center by linking monitoring with environmental education.
    Students will monitor the site for vegetative and wildlife response prior, during,
    and post project completion.",nt"license_title": "License Not Specified",nt"extras":
